import React from "react"
import Button from '@material-ui/core/Button'
import { withStyles } from '@material-ui/core/styles'
//import "./button_coloer"

const useStyles = theme => ({
  pink_btn: {
    background: 'pink'
  },
  purple_btn: {
    background: 'purple'
  },
  cyan_btn: {
    background: 'cyan'
  },
})

class IndexButtons extends React.Component {
  classes = useStyles();
  render() {
    return (
      <React.Fragment>
        <Button variant="contained" color="inherit">その１ボタン</Button>
        <Button variant="contained" color="inherit">その２ボタン</Button>
        <Button variant="contained" className={classes.pink_btn}> Style直接指定したボタン</Button>
      </React.Fragment>
    );
  }
}

export default IndexButtons
